import Header from "./components/header";
import Sidebar from "./components/sidebar";

function App() {
  return (
    <div>
      <Header />
      <div style={{width: '100%', display: 'flex'}}>
        <Sidebar />
        <div style={{backgroundColor: 'blue', width: '100%'}}>

        </div>
      </div>
    </div>
  );
}

export default App;
